import {Routes, Route} from 'react-router-dom'

function Home(){
  return(
    <>
      <h1>Home page</h1>
    </>
  );
}

function Admin(){
  return(
    <>
      <h1>Admin panel</h1>
    </>
  );
}

function App() {
  return (
    // <div className="App">
    //     Test
    // </div>

    <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='/admin' element={<Admin/>}/>
    </Routes>
  );
}

export default App;
